import React from 'react';
import Project_1 from './images/project1.jpg';

function ProjectCarousel() {

  return (
    <section id="projects" style={{ marginLeft: "10px", display: "flex", alignItems: "center", flexDirection: "column", color: '#000000' }}>
      <h2>Projects</h2>
      <div>
        <img src={Cert_1} alt="Certificate 1" style={{ margin: '10px', width: '30%' }}/>
        <img src={Cert_2} alt="Certificate 2" style={{ margin: '10px', width: '30%' }}/>
        <img src={Cert_3} alt="Certificate 3" style={{ margin: '10px', width: '30%' }}/>
      </div>
    </section>
  );
}

export default ProjectCarousel;
